import React from 'react';
import { Col, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function AprendeJavascript(){
    function lectura(){}
    return(
        <Container>
            <Col sm={3}>
            <ul class="list-group">
            <Link to='../profile/information'> <li onClick={lectura} name="information" class="list-group-item bg-dark text-light li1">Information</li></Link>
            <Link to='../profile/change'><li onClick={lectura} class="list-group-item bg-dark text-light li1" >Change password</li></Link>
            <Link to='../profile/delete'><li onClick={lectura} class="list-group-item bg-dark text-light li1">Delete courses</li>  </Link>
            <Link to='../profile/drop'><li onClick={lectura} class="list-group-item bg-dark text-light li1">Drop out</li></Link>
           <li  class="list-group-item bg-dark text-light li1">Logout</li>
            </ul>
            </Col> 
            <Col>
            <iframe width="auto" height="auto" src="https://www.youtube.com/embed/z95mZVUcJ-E" title="Curso de JAVASCRIPT desde CERO (Completo) - Nivel JUNIOR" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
            </Col>
        </Container>
        
    )
}

export {AprendeJavascript}
